import React from "react";
import styles from "./styles.module.css";
function form() {
  return (
    <form>
      <div className="form-group" className={styles.cursor}>
        <input
          className="form-control-plaintext "
          type="search"
          placeholder="Search....."
        />
        <i></i>
      </div>
    </form>
  );
}

export default form;
